class.meta:
public TipoEstrutura duplicate(DuplicateBag bag) {
	if(bag.fits(this)){
		TipoEstrutura te = new TipoEstrutura();
		bag.store(this,te);
		te.setCodigo(this.getCodigo());
		te.setId(this.getId());
		te.setNome(this.getNome());
		te.setTipoClassificacaoModelo(this.getTipoClassificacaoModelo() == null ? null : this.getTipoClassificacaoModelo().duplicate(bag));
	}
	return (TipoEstrutura) bag.retrieve(this);
}

